    t[1410] = "The wizard will set reasonably sensible default values for these, but you can view and/or edit these by clicking on the tunnel's name in the main I2PTunnel page.";
    t[1411] = "\ub9c8\ubc95\uc0ac\ub294 \uc774\ub7ec\ud55c \uc635\uc158\uc5d0 \ub300\ud574 \ud569\ub9ac\uc801\uc778 \uae30\ubcf8\uac12\uc744 \uc124\uc815\ud558\uc9c0\ub9cc, \uba54\uc778 I2PTunnel \ud398\uc774\uc9c0\uc5d0\uc11c \ud130\ub110 \uc774\ub984\uc744 \ud074\ub9ad\ud558\uc5ec \uc774\ub97c \ubcfc \uc218 \uc788\uc73c\uba70 \ud544\uc694\uc5d0 \ub530\ub77c \ud3b8\uc9d1\ud560 \uc218\ub3c4 \uc788\uc2b5\ub2c8\ub2e4.";
