    t[1425] = "\ub300\uccb4 \uac1c\uc778\ud0a4 \ud30c\uc77c";
    t[1430] = "See above for required items.";
    t[1431] = "\ud544\uc694\ud55c \ud56d\ubaa9\uc740 \uc704\ub97c \ucc38\uc870\ud558\uc138\uc694.";
    t[1432] = "Conserve resources by only creating tunnels when required";
    t[1433] = "\ud544\uc694\ud560 \ub54c\ub9cc \ud130\ub110\uc744 \uc0dd\uc131\ud558\uc5ec \ub9ac\uc18c\uc2a4\ub97c \uc808\uc57d\ud569\ub2c8\ub2e4";
    t[1438] = "IRC server";
    t[1439] = "IRC \uc11c\ubc84";
